import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div className="container home-page">
            <div className="logo-section">
                {/* Your logo components go here */}
            </div>
            <div className="content">
                <div className="text-zone">
                    <h1>French Bull Dog Puppies</h1>
                    <h1>FOR SALE!</h1>
                    <h2>small bits of information about dogs</h2>
                </div>
                <div className="contact-link">
                    <Link to="/contact" className='flat-button'>CONTACT FOR ADOPTION</Link>
                </div>
            </div>
        </div>
    );
};

export default Home;
